function Demo(){
    const countries =['india','australia','america'];
    const results=[];
    if(countries.length>0){
        countries.forEach((country)=>{
            results.push(
                <div >

                <p>{country}</p>
                </div>,
            );
        });
    }

    for(let country of countries ){
        results.push(
            <div>
            <p>{country}</p>
            </div>
        );
    }
}
export default Demo;
